import React from "react";
import BarNote from "../../ui/BarNote";
import Icons from "../../../assets/Icons";
const Notes = () => {
  return (
    <div className="right-bar">
      <div className="noted border-2px">
        <BarNote />

        <br />

      </div>
      <div className="dp-f display-notes border-2px">
<div className="notes">
</div>
      </div>
    </div>
  );
};
export default Notes;
